import{e as p}from"./app.630af5f2.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const e={},a=p('<h1 id="r" tabindex="-1"><a class="header-anchor" href="#r" aria-hidden="true">#</a> R\u2026</h1><p>\u686B\u6469\u91CD\u89C1\u5929\u5149\u7684\u65F6\u5019\uFF0C\u5929\u5149\u5DF2\u4E0D\u518D\u662F\u5929\u5149\u3002</p><p>\u592A\u9633\u5B64\u60AC\u5728\u897F\uFF0C\u5982\u4E00\u76CF\u865A\u51B7\u6697\u706F\u3002</p><p>\u4ED6\u7EC8\u6765\u5230\u52A0\u7F2A\u96EA\u5C71\uFF0C\u770B\u89C1\u9AD8\u8038\u5165\u4E91\u7684\u4F17\u795E\u4E4B\u5854\uFF0C\u5B83\u5DCD\u5CE8\u7684\u5C79\u7ACB\u5728\u5F7C\uFF0C\u5C31\u50CF\u4E00\u6839\u96C4\u4F1F\u7684\u9634\u830E\u76F4\u523A\u5929\u4E91\u3002</p><p>\u6DF1\u79CB\u7684\u9EC4\u660F\uFF0C\u5927\u98CE\u5439\u5F97\u94C1\u94FE\u4E0D\u5B81\u3002</p><p>\u4ED6\u77E5\u9053\uFF0C\u5965\u6258\u5728\u5854\u5185\u9690\u85CF\u3002</p><p>\u82CD\u5170\u3002</p><p>\u82CD\u5170\u770B\u89C1\u9EC4\u660F\u7684\u5929\u7A7A\u5BC6\u5E03\u5C42\u4E91\uFF0C\u7B3C\u7F69\u5728\u6574\u4E2A\u62DC\u4E9A\u65AF\u5927\u9646\u3002\u98CE\u5439\u5F97\u5FC3\u7EEA\u4E0D\u5B81\u3002</p><p>\u5927\u7EA6\u8FD8\u6709\u4E24\u4E2A\u5C0F\u65F6\u7684\u8DEF\u9014\u3002\u5979\u6371\u4E0D\u8FC7\uFF0C\u7ADF\u5C55\u5F00\u4E00\u5BF9\u7FFC\u51CC\u7A7A\u98DE\u5EA6\u3002</p><p>\u686B\u6469\u2014\u2014</p><p>\u5979\u9ED8\u9ED8\u5FF5\u7740\u4ED6\u7684\u540D\u5B57\u3002\u96BE\u9759\u3002</p><p>\u8111\u6D77\u95F4\u4E0D\u53EF\u907F\u514D\u56DE\u54CD\u8D77\u90A3\u9996\u6B4C\u6765\uFF0C\u5173\u4E8E\u547D\u6570\u7684\u6B4C\u3002\u7D0A\u4E71\u3002</p><p>\u5965\u6258\u3002</p><p>\u5965\u6258\u5927\u5E1D\u7B97\u5B9A\u82CD\u5170\u627E\u4E0D\u5230\u686B\u6469\uFF0C\u66F4\u7B97\u5B9A\u5979\u5FC5\u6765\u5230\u4F17\u795E\u4E4B\u5854\u3002\u5979\u5FC5\u4F1A\u53BB\u5230\u9876\u5C16\uFF0C\u5984\u60F3\u5BF9\u8BDD\u90A3\u4E2A\u675C\u64B0\u7684\u795E\u660E\u3002\u5979\u5FC5\u4F1A\u63EA\u5FC3\u5929\u7A7A\u7684\u547D\u8FD0\u3002</p><p>\u800C\u5B9E\u9645\uFF0C\u5728\u4F17\u795E\u4E4B\u5854\u7684\u9876\u5C16\uFF0C\u9664\u4E86\u51E0\u79CD\u7248\u672C\u7684\u8FF7\u4FE1\u4F20\u8BF4\u3002\u53EA\u6709\u516B\u6839\u53E4\u65E9\u7684\u77F3\u67F1\u5EF6\u4F38\u51FA\u8D2F\u8FDE\u5730\u9762\u7684\u94C1\u94FE\uFF0C\u4E4B\u5916\u4FBF\u53EA\u5F97\u7A7A\u7A7A\u5982\u4E5F\u7684\u4E00\u7247\u6F06\u9ED1\u3002</p><p>\u5728\u516B\u6839\u77F3\u67F1\u4E4B\u95F4\uFF0C\u5374\u6709\u7740\u5965\u6258\u5E03\u4E0B\u7684\u7ED3\u754C\u3002\u8BA9\u7B2C\u4E00\u4E2A\u8E0F\u8DB3\u5176\u95F4\u7684\u4EBA\u6563\u5931\u52A8\u5F39\u7684\u529B\uFF0C\u4FBF\u4E3A\u9501\u94FE\u684E\u688F\u3002</p><p>\u5F53\u4ED6\u60CA\u95FB\u8D1D\u73B2\u8FBE\u751F\u51FA\u7684\u662F\u4E71\u4F26\u7684\u5A74\u513F\uFF0C\u800C\u4E0D\u662F\u686B\u6469\u7684\u9AA8\u8089\u3002\u4ED6\u4E0D\u5F97\u4E0D\u6539\u53D8\u539F\u5148\u7684\u76D8\u7B97\u3002\u8FD9\u6216\u8BB8\u662F\u67D0\u79CD\u6CE8\u5B9A\uFF0C\u4ED6\u53EA\u5F97\u6740\u6B7B\u53EF\u601C\u7684\u686B\u6469\uFF0C\u7136\u540E\u4E00\u8FB9\u8E42\u8E8F\u7740\u81EA\u5DF1\u7684\u5973\u513F\uFF0C\u4E00\u8FB9\u5012\u6570\u7740\u7B49\u5F85\u82CD\u5170\u5815\u8FDB\u5708\u5957\u3002</p><p>\u4ED6\u770B\u8FC7\u686B\u6469\u5199\u7ED9\u82CD\u5170\u7684\u6BCF\u4E00\u5C01\u4FE1\u3002\u4ED6\u751A\u81F3\u6000\u7591\u686B\u6469\u7A76\u7ADF\u662F\u4E0D\u662F\u90A3\u4E2A\u56E0\u4E3A\u9B54\u7F6A\u88AB\u56DA\u5341\u5E74\u7684\u7687\u5B50\uFF0C\u4ED6\u7B80\u76F4\u66F4\u50CF\u771F\u5584\u7F8E\u7684\u5316\u8EAB\u3002</p><p>\u5728\u90A3\u4E9B\u4FE1\u4E2D\uFF0C\u4ED6\u770B\u89C1\u6696\u6696\u9633\u5149\u4E0B\u7684\u6696\u6696\u4EB2\u60C5\u3002</p><p>\u800C\u8FD9\u4E0D\u662F\u4ED6\u60F3\u8981\u7684\u3002\u4ED6\u5E0C\u671B\u770B\u5230\u4E00\u4E2A\u5FCC\u5992\u3001\u7126\u8E81\u5E26\u7740\u5DE8\u5927\u6028\u5FF5\u7684\u5A11\u6469\u3002\u7136\u540E\u5F15\u8BF1\u4ED6\uFF0C\u5C31\u50CF\u86C7\u5F15\u8BF1\u53EF\u601C\u7684\u4EBA\u7C7B\u3002\u7136\u540E\u4F7F\u4ED6\u8FF7\u5931\uFF0C\u6B65\u5165\u638C\u63A7\u3002</p><p>\u7136\u540E\u4ED6\u5C31\u4FBF\u6709\u7406\u7531\u89CA\u89CE\u90A3\u9AD8\u8D35\u7684\u5973\u5B50\u548C\u9AD8\u5904\u7684\u57CE\u3002</p><p>\u4ED6\u66FE\u7ECF\u5F53\u7740\u686B\u6469\u7684\u9762\u548C\u5973\u513F\u5448\u73B0\u66A7\u6627\u7684\u5F62\u4F53\u8BED\u8A00\uFF0C\u800C\u686B\u6469\u53EA\u662F\u7B11\u7B11\uFF0C\u7528\u6E29\u826F\u4EB2\u548C\u7684\u773C\u795E\u770B\u7740\u4E00\u5BF9\u7236\u5973\uFF0C\u5982\u6B64\u800C\u5DF2\u3002</p><p>\u8FD9\u523B\uFF0C\u8D1D\u73B2\u8FBE\u7684\u5C0F\u8179\u5DF2\u7ECF\u56DE\u590D\u4ECE\u524D\u7684\u5E73\u5766\uFF0C\u800C\u4E73\u623F\u53BB\u6EA2\u51FA\u767D\u8272\u7684\u7518\u7F8E\u6C41\u6DB2\u3002</p><p>\u4ED6\u628A\u5979\u653E\u6210\u6BCD\u72AC\u7684\u59FF\u6001\uFF0C\u8BA9\u9633\u5149\u7A7F\u8D8A\u5899\u4E0A\u7684\u6D1E\u5B54\uFF0C\u503E\u6CC4\u5728\u5979\u7F8E\u5999\u7684\u80F4\u4F53\u3002</p><p>\u5206\u5A29\u540E\u7684\u9634\u9053\u662F\u4F24\u53E3\uFF0C\u4ED6\u7528\u4ED6\u521A\u6BC5\u7684\u4E0B\u4F53\u629A\u6170\u7740\u3002\u7A7F\u8FC7\u5979\u6D53\u5BC6\u7684\u67D4\u8F6F\u7684\uFF0C\u6CBE\u7740\u9C9C\u8840\u548C\u7F8A\u6C34\u7684\u9634\u6BDB\uFF0C\u63D2\u8FDB\u5979\u88C2\u5F00\u7684\u4F24\u53E3\u3002</p><p>\u4ED6\u7528\u624B\u6324\u538B\u5979\u4E30\u6EE1\u8D77\u6765\u7684\u4E73\u623F\uFF0C\u5C3D\u7BA1\u50CF\u82B1\u854A\u4E00\u6837\u7684\u4E73\u5934\u4E0D\u518D\u662F\u9C9C\u5AE9\u7684\u7C89\u7EA2\uFF0C\u800C\u72B9\u5982\u6D93\u6D93\u7EC6\u6D41\u7684\u4E73\u6DB2\u6ECB\u6DA6\uFF0C\u5374\u5E26\u7740\u4ED6\u6700\u5927\u7684\u5FEB\u4E50\u3002</p><p>\u4ED6\u65E0\u6CD5\u51C6\u786E\u7684\u5F62\u5BB9\u8FD9\u4E2A\u5973\u4EBA\u7ED9\u4ED6\u7684\u611F\u89C9\u3002</p><p>\u56E0\u4E3A\u5979\u5DF2\u7ECF\u5F62\u5982\u4E00\u5177\u5C38\u3002</p><p>\u6CA1\u6709\u547B\u541F\uFF0C\u6CA1\u6709\u75DB\u695A\uFF0C\u6CA1\u6709\u773C\u6CEA\uFF0C\u6CA1\u6709\u98A4\u6296\uFF0C\u6CA1\u6709\u5EC9\u803B\uFF0C\u6CA1\u6709\u601D\u7EF4\u3002</p><p>\u5979\u53EA\u6709\u4E00\u5904\u9634\u9053\u7684\u7A7A\u95F4\uFF0C\u4F9B\u7ED9\u7236\u4EB2\u7684\u63D2\u5165\u3002\u53EA\u7559\u4E00\u5BF9\u4E73\u623F\u7684\u6D41\u6CEA\uFF0C\u627F\u8F7D\u7740\u5979\u7684\u906D\u9047\u3002\u5979\u66FE\u662F\u76F8\u4FE1\u7231\u7684\uFF0C\u628A\u81EA\u5DF1\u7684\u5FC3\u90FD\u655E\u5F00\u7ED9\u4E86\u686B\u6469\uFF0C\u5374\u628A\u53CC\u817F\u655E\u5F00\u7ED9\u4E86\u7236\u4EB2\u837C\u6BD2\u3002</p><p>\u5979\u628A\u6240\u6709\u7684\u7231\u653E\u8FDB\u686B\u6469\u58EE\u9614\u7684\u80F8\u895F\uFF0C\u5374\u628A\u7236\u4EB2\u7684\u7CBE\u6DB2\u653E\u8FDB\u6E29\u6696\u7684\u5B50\u5BAB\u3002</p><p>\u5728\u5979\u4EE5\u4E3A\u6700\u5E78\u798F\u7684\u5149\u666F\uFF0C\u4E5F\u90FD\u662F\u627F\u53D7\u4E00\u5206\u4E3A\u4E8C\u7684\u89D2\u8272\u3002\u6709\u7684\u65F6\u5019\uFF0C\u7236\u4EB2\u8BA9\u5979\u6446\u6210\u6B3E\u5F0F\u653E\u8361\u7684\u59FF\u6001\uFF0C\u5979\u754F\u60E7\u5E78\u798F\u7834\u706D\uFF0C\u4FBF\u53EA\u6709\u4F9D\u4F9D\u3002</p><p>\u800C\u5F53\u5979\u77DC\u6301\u5728\u7231\u4EBA\u7684\u7761\u5E8A\uFF0C\u4F1A\u611F\u89C9\u4E0D\u9002\u3002\u8FD9\u5E78\u798F\u7684\u4EE3\u4EF7\u7ADF\u662F\u5982\u6B64\u8270\u8F9B\u3002\u5C3D\u7BA1\u686B\u6469\u7684\u9634\u830E\u96C4\u4F1F\u9A81\u52C7\uFF0C\u5979\u8FD8\u662F\u6697\u81EA\u5782\u6CEA\uFF0C\u4EE5\u4E3A\u82E6\u77ED\u3002</p><p>\u5F53\u5979\u671B\u89C1\u521D\u751F\u7684\u5A74\u513F\u7738\u5B50\uFF0C\u5979\u5DF2\u7ECF\u5F00\u59CB\u75AF\u72C2\u5D29\u584C\u3002\u4E00\u4E2A\u67D4\u5F31\u7684\u5973\u5B50\u7ADF\u8981\u627F\u8F7D\u8FD9\u6837\u7684\u547D\u8FD0\uFF0C\u5F53\u5979\u628A\u624B\u6307\u63D2\u8FDB\u77B3\u5C0F\u5C0F\u7684\u773C\u7736\uFF0C\u4FBF\u5168\u90E8\u5931\u53BB\u4E86\u5FC3\u6027\u3002\u77B3\u54ED\u5F97\u6495\u5FC3\u88C2\u80BA\uFF0C\u7528\u5C0F\u624B\u6323\u624E\u5728\u5979\u4E73\u623F\u4E0A\u62CD\u6253\u6293\u6320\u3002\u5728\u6700\u540E\u6E05\u9192\u7684\u610F\u8BC6\uFF0C\u5979\u60F3\u8D77\u6765\u90A3\u4E00\u5929\u5728\u5E7D\u6697\u4E2D\uFF0C\u5979\u5728\u6323\u624E\u4E2D\u5212\u7834\u686B\u6469\u7684\u76AE\u80A4\u3002</p><p>\u5728\u90A3\u4E00\u4E2A\u77AC\u95F4\uFF0C\u5979\u4E0D\u518D\u662F\u90A3\u4E2A\u9759\u9759\u987A\u53D7\u7684\u8D1D\u73B2\u8FBE\u3002\u5979\u53EA\u662F\u4E00\u5177\u4E27\u5FC3\u75C5\u72C2\u7684\u5973\u4F53\uFF0C\u5979\u7684\u7075\u9B42\u65E9\u5DF2\u88AB\u8FD9\u4E9B\u591A\u5384\u7684\u714E\u71AC\u71AC\u6210\u6B7B\u7070\u3002</p><p>\u5728\u7236\u4EB2\u7684\u62BD\u63D2\u4E0B\uFF0C\u5979\u4E0D\u518D\u6709\u75DB\uFF0C\u4E0D\u518D\u6709\u803B\uFF0C\u4E0D\u518D\u6709\u4F4E\u5934\u548C\u9AD8\u6F6E\u3002</p><p>\u7236\u4EB2\u628A\u7CBE\u6DB2\u5C04\u5411\u5979\u7389\u817F\u4E4B\u95F4\uFF0C\u5C04\u5728\u5979\u773C\u89D2\u7709\u68A2\u3002\u5979\u53EA\u662F\u65E0\u58F0\u8F6C\u9762\uFF0C\u7528\u5BD2\u51B7\u51C4\u5389\u7684\u76EE\u5149\u671B\u7740\u4ED6\u91CE\u517D\u822C\u7684\u9762\u76F8\u3002</p><p>\u90A3\u4E8E\u662F\u62BD\u50CF\u6210\u6A21\u7CCA\u7684\u5149\u5F71\uFF0C\u5C31\u50CF\u51B7\u51B7\u7684\u7E41\u82B1\uFF0C\u5C31\u50CF\u6696\u6696\u7684\u5929\u5149\u3002\u90A3\u4E0D\u518D\u4E0E\u5979\u6709\u5E72\uFF0C\u5C31\u50CF\u5B50\u5BAB\u5185\u6DCC\u8840\u7684\u865A\u7A7A\uFF0C\u5F77\u4F5B\u4ECE\u672A\u6709\u8FC7\u4EC0\u4E48\u7559\u4E0B\u6765\u8FC7\u3002</p><p>\u8FD9\u672C\u662F\u5145\u6EE1\u60CA\u6035\u7684\u4E00\u5E55\u3002</p><p>\u800C\u5965\u6258\u5374\u89C9\u5F97\u5979\u771F\u7684\u50CF\u82CD\u5170\uFF0C\u4ED6\u8F7B\u8F7B\u629A\u6469\u5979\u6D01\u767D\u65E0\u6687\u7684\u810A\u80CC\uFF0C\u5FAE\u5FAE\u95ED\u4E0A\u773C\u603B\u662F\u5E0C\u671B\u90A3\u91CC\u80FD\u751F\u51FA\u4E00\u5BF9\u6F02\u4EAE\u7684\u7FBD\u7FFC\u3002</p><p>\u4ED6\u4E8E\u662F\u53C8\u52C3\u8D77\u3002</p><p>\u800C\u5979\u7684\u8EAB\u4F53\u4EA6\u5728\u8FD9\u523B\u5931\u5374\u6700\u540E\u6E29\u5EA6\u3002</p><p>\u5979\u7A7F\u7740\u5AE3\u7EA2\u7684\u9713\u88F3\uFF0C\u5750\u5728\u6E29\u67D4\u7684\u70DB\u5149\uFF0C\u5934\u6234\u7FBD\u51A0\uFF0C\u957F\u88D9\u5A46\u5A11\u3002</p><p>\u300C\u7F8E\u4E3D\u7684\u8D1D\u73B2\u8FBE\uFF0C\u548C\u98CE\u56E0\u4F60\u6765\uFF0C\u82B1\u513F\u4E3A\u4F60\u5F00\uFF1B\u51E1\u95F4\u7684\u5929\u4F7F\u554A\uFF0C\u7FC5\u8180\u662F\u4E91\u5F69\u2026</p><p>\u2026\u300D</p><p>\u5728\u5979\u8EAB\u4F53\u5F7B\u5E95\u51B0\u51B7\u524D\u7684\u524D\u5915\uFF0C\u66FE\u6D6E\u73B0\u8BF8\u5982\u6B64\u7C7B\u7684\u5E7B\u542C\u3002</p><p>\u6696\u800C\u8273\u3002</p>',47);function t(c,n){return a}var _=r(e,[["render",t]]);export{_ as default};
